import React, { Component } from "react";
// import { Navbar, Nav } from "react-bootstrap";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBCollapse,
  MDBContainer,
  MDBHamburgerToggler
} from "mdbreact";
import { Link } from "react-router-dom";

export default class Navigation extends Component {
  state = {
    collapse1: false,
    collapseID: ""
  };
  toggleCollapse = collapseID => () => {
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ""
    }));
  };

  toggleSingleCollapse = collapseId => {
    this.setState({
      ...this.state,
      [collapseId]: !this.state[collapseId]
    });
  };
  render() {
    return (
      <div className="nav-container">
        {/* <Navbar className="py-3 px-3 h-100" bg="white" variant="light">
          <Navbar.Brand
            className="w-50
          "
            href="home"
          >
            Physio Revolution
          </Navbar.Brand>

          <Nav className="mr-auto text-primary nav-link-colour "> */}
        {/* <Link className="link" to="/home">
              Home
            </Link>
            <Link className="link" to="/about">
              About
            </Link>
            <Link className="link" to="/services">
              Services
            </Link>
            <Link className="ml-2 link" to="/faq">
              F.A.Q
            </Link>
            <Link className="link" to="/contact">
              Contact
            </Link>
            <Link className="ml-2 link" to="/shop">
              Shop
            </Link> */}
        {/* </Nav>
        </Navbar> */}

        <MDBContainer>
          <MDBNavbar color="bg-primary" dark>
            <MDBContainer className="row">
              <MDBNavbarBrand className="col-6">MDBNavbar</MDBNavbarBrand>
              <MDBHamburgerToggler
                color="white"
                className="col-6 w-25 float-right"
                id="hamburger1"
                onClick={() => this.toggleSingleCollapse("collapse1")}
              />
              <MDBCollapse isOpen={this.state.collapse1} navbar>
                <MDBNavbarNav left>
                  <MDBNavItem active>
                    <MDBNavLink to="/home">Home</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to="/about">About</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to="/services">Services</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to="/faq">F.A.Q</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to="/contact">Contact</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to="/shop">Shop</MDBNavLink>
                  </MDBNavItem>
                </MDBNavbarNav>
              </MDBCollapse>
            </MDBContainer>
          </MDBNavbar>
        </MDBContainer>
      </div>
    );
  }
}
